import React, { Component } from "react";

class Members extends Component {
  render() {
    return (
      <div>
        <h2>Members</h2>
        <p>White Group name list:</p>
        <ol>
          <li>Ai</li>
          <li>Haneih</li>
          <li>Mariana</li>
          <li>Miku</li>
          <li>Shiki</li>
        </ol>
      </div>
    );
  }
}

export default Members;
